export default class SimpleSlider extends React.Component {
	render(){
		let settings = { 
			dots: true,
			className: 'sample'
		}
		return (
			<Slider {...settings} >
				<div><img src='http://placekitten.com/g/400/200' /></div>
				<div><img src='http://placekitten.com/g/400/200' /></div>
				<div><img src='http://placekitten.com/g/400/200' /></div>
			</Slider>
			)
	}
}
